import { Component } from '@angular/core';
import { ParticipantsService } from '../participant.service';

@Component({
  selector: 'app-event-enroll',
  templateUrl: './participant-eventenroll.component.html',
  styleUrls: ['./participant-eventenroll.component.css']
})
export class ParticipantEventenrollComponent {
  participantId!: number;
  eventId!: number;
  message = '';

  constructor(private service: ParticipantsService) {}

  enroll() {
    this.service.enroll(this.participantId, this.eventId).subscribe({
      next: res => this.message = res.message,
      error: err => this.message = err.error
    });
  }
}
<div class="page-container">
  <h2>Enroll in Event</h2>

  <form (ngSubmit)="enroll()">
    <!-- Participant Dropdown -->
    <div class="form-group">
      <label for="participantId">Select Participant</label>
      <select
        id="participantId"
        name="participantId"
        class="form-control"
        required
        [(ngModel)]="participantId"
      >
        <option [ngValue]="null" disabled>Select a participant</option>
        <option *ngFor="let p of par" [ngValue]="p.participantId">
          {{ p.participantId }} - {{ p.name }}
        </option>
      </select>
    </div>

    <!-- Event Dropdown -->
    <div class="form-group">
      <label for="eventId">Select Event</label>
      <select
        id="eventId"
        name="eventId"
        class="form-control"
        required
        [(ngModel)]="eventId"
      >
        <option [ngValue]="null" disabled>Select an event</option>
        <option *ngFor="let e of events" [ngValue]="e.eventId">
          {{ e.eventId }} - {{ e.title }}
        </option>
      </select>
    </div>

    <!-- Submit Button -->
    <button type="submit" class="btn btn-primary" [disabled]="loading">
      {{ loading ? 'Enrolling...' : 'Enroll' }}
    </button>
  </form>

  <!-- Message -->
  <p class="message" *ngIf="message">{{ message }}</p>
</div>
